'''Eternal Jeweller''' is a Tier 2 Relic in the [[Trailblazer League]]. Selecting Eternal Jeweller gives the following benefits:

* Players will receive a [[ring of dueling]], [[ring of returning]], [[ring of wealth]], [[games necklace]], [[skills necklace]], and a [[necklace of passage]].

* The following items will no longer consume charges:
** [[Master scroll book]]
** [[Ring of dueling]]
** [[Ring of returning]]
** [[Slayer ring]]
** [[Ring of wealth]]
** [[Amulet of glory]]
** [[Games necklace]]
** [[Skills necklace]]
** [[Digsite pendant]]
** [[Combat bracelet]]
** [[Necklace of passage]]

Because the player is given items, this relic must be unlocked in a [[bank]].

